(2, 'Puan soal Demo RUU Kesehatan: DPR Sudah Selesai, Bisa ke Pemerintah', 'Jakarta - Ketua DPR RI Puan Maharani menanggapi demonstrasi terkait penolakan pengesahan RUU Kesehatan.', '<p><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">Puan mengatakan sejak awal Komisi IX DPR RI bersama pemerintah sudah membuka seluas-luasnya aspirasi kepada masyarakat.</span></p><blockquote class=\"\"><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">\"<i>Terkait dengan RUU kesehatan DPR melalui Komisi IX dan pemerintah melalui Kementerian Kesehatan sudah membuka ruang seluas-luasnya kepada semua pihak yang kemudian mempunyai kepentingan, aspirasi, dan masukan dalam pembahasan-pembahasan yang dilakukan secara simultan beberapa bulan yang lalu,</i>\" kata Puan seusai rapat paripurna, kompleks parlemen, Selasa (11/7/2023).</span></blockquote><p><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">Puan menyebut DPR sudah rampung menyelesaikan RUU Kesehatan menjadi undang-undang. Jika ada aspirasi yang belum ditampung, ia menyarankan disampaikan langsung kepada pemerintah melalui Kementerian Kesehatan.</span></p><p><blockquote class=\"\"><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">\"<i>Jadi kalau kemudian ada pihak pihak yang merasa bahwa masukan aspirasi, hak konstitusionalnya kemudian belum terakomodir mungkin bisa menyampaikannya lagi kepada pemerintah karena DPR sudah selesai,</i>\" ujar Puan.</span></blockquote><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">\"<i>Bisa memberikan masukan tersebut aspirasi tersebut kepada pemerintah melalui kementerian kesehatan,</i>\" sambungnya.</span><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">Ia mengatakan, jika aspirasi itu belum memberikan hasil yang diinginkan, masyarakat bisa mengajukan gugatan ke Mahkamah Konstitusi (MK). Menurutnya, cara ini bisa ditempuh secara konstitusional.</span><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">\"<i>Namun, kalau kemudian merasa atau dianggap hal itu belum cukup, kita kan punya tempat lain untuk kemudian menampung aspirasi tersebut melalui MK,</i>\" kata Puan.</span><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><br style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">\"<i>Jadi silakan saja ini negara hukum, semua proses mekanisme yang ada sudah kami lakukan, kalau kemudian merasa kurang puas masih ada MK yang kemudian bisa menjadi salah suatu tempat untuk bisa menampung aspirasi dan masukan secara konstitusional,</i>\" imbuhnya.</span><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><br></span></p><p><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\">Diketahui, Rancangan Undang-Undang (RUU) tentang Kesehatan resmi disahkan menjadi undang-undang. Pengesahan RUU Kesehatan dilakukan dalam Rapat Paripurna (Rapur) DPR RI Masa Persidangan V Tahun Sidang 2022-2023 hari ini.</span><span style=\"font-family: Helvetica-FF, Arial, Tahoma, sans-serif;\"><br></span><br></p>', 'uploads/img//1689089829_138aae1ffafb83add326.jpeg', '2023-07-11 19:29:18', '2023-07-11 22:48:35', 'active', 2, 5),
(5, 'Hiii Bro', 'Apa Kabs Nih', '<p>lolololo ga bahaya tahhh</p>', 'uploads/img//1689089339_f3da5013d78a106b6f2f.png', '2023-07-11 20:43:05', '2023-07-12 08:14:08', 'deactive', 4, 7),
(6, 'Ukraina Panas! Zelensky Tiba-Tiba Serang NATO', 'Jakarta, NEWSHu. - Presiden Ukraina Volodymyr Zelensky tiba-tiba menyerang NATO. Ini terkait keanggotaan negeri itu di aliansi tersebut.', '<p style=\"margin-top: 16px; margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Hingga kini, Ukraina belum diterima sebagai anggota NATO meski kerap mengutarakan keinginannya. Terbaru, pemimpin NATO memberi sinyal tak akan menjanjikan keanggotaan meski perang usai dengan Rusia.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Sepertinya tidak ada kesiapan untuk mengundang Ukraina ke NATO atau menjadikannya anggota aliansi,\" katanya di Telegram, menurut terjemahan Google Selasa waktu setempat, sebagaimana dimuat&nbsp;<em>CNBC International,</em>&nbsp;Rabu (12/7/2023).</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Bagi Rusia, ini berarti motivasi untuk melanjutkan terornya,\" tegasnya.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Belum pernah terjadi sebelumnya dan tidak masuk akal,\" sindir Zelensky lagi.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"><span style=\"background-color: var(--bs-card-bg); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Diketahui KTT NATO sedang berlangsung di Vilnius, Lithuania 11 hingga 12 Juli. Sebelumnya NATO menyelesaikan permasalahan keanggotaan baru Swedia yang selama ini ditentang Turki.</span></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Kemarin, NATO juga menyepakati komunike KTT terkait keanggotaan Ukraina. Aliansi yang beranggotakan berjanji untuk \"menyampaikan undangan\" ke Ukraina untuk bergabung dengan aliansi ketika \"sekutu setuju dan kondisi terpenuhi\".</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Sekretaris Jenderal (Sekjen) NATO Jens Stoltenberg mengatakan komitmen tersebut akan merampingkan proses aksesi dan membuat keanggotaan Ukraina hanya bergantung pada keputusan politik. Ini, tegasnya, akan mengubah jalur keanggotaan Ukraina dari proses dua langkah menjadi proses satu langkah.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Namun menurut Zelensky, sebagaimana dimuat&nbsp;<em>Financial Times (FT)</em>, komunike NATO dibuat tanpa Kyiv dimeja perundingan. Komunike tersebut menyatakan bahwa \"masa depan Kyiv ada di NATO\" tetapi tidak memberikan batas waktu untuk aksesinya.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Ukraina sendiri telah lama mengutarakan keinginannya mask NATO. Bahkan sebelum perang Rusia dan Ukraina pecah di Februari 2022 hingga kini.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Keinginan itu pula yang menjadi salah satu alasan Rusia menyerang negeri itu. Pemerintahan Presiden Vladimir Putin menilai ekspansi NATO ke Ukraina membahayakan negaranya.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Namun hal ini membuat perpecahan suara di NATO. Hal ini terlihat selama berminggu-minggu negosiasi.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Amerika Serikat (AS) dan Jerman dilaporkan sangat berhati-hati terkait keanggotaan Kyiv. Di sisi lain, sebagian besar anggota Eropa timur, dengan dukungan Prancis dan Inggris, telah meminta kata \"undangan\" dimasukkan dalam pernyataan, di mana undangan itu akan menjadi keputusan politik bukan keputusan teknis.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Tempat yang sah bagi Ukraina adalah di NATO,\" kata Perdana Menteri (PM) Inggris Rishi Sunak.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Di sisi lain, mengutip<em>&nbsp;Interfax,</em>&nbsp;juru bicara Putin mengatakan apa pun untuk mempercepat masuknya Ukraina ke NATO akan \"sangat berbahaya bagi keamanan Eropa\". Ia menyebut \"membawa banyak risiko dan orang-orang yang membuat keputusan itu harus mengakuinya\".</p>', 'uploads/img/5/1689121375_8b4ed8470a64d7f3d1c9.jpeg', '2023-07-12 07:22:55', '2023-07-12 07:37:44', 'active', 1, 7);
INSERT INTO `news` (`id_news`, `title`, `sub_title`, `content`, `thumb`, `created_at`, `updated_at`, `status`, `id_category`, `id`) VALUES
(7, 'Kata-kata Aldila Usai Lolos Semifinal Wimbledon 2023', 'Jakarta, NEWSHub. -- Aldila Sutjiadi yang berpasangan dengan Matwe Middelkoop bikin kejutan dengan berhasil melaju ke semifinal ganda campuran Wimbledon 2023.', '<p><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Aldila/Middelkoop melangkah ke semifinal Wimbledon 2023 setelah menyingkirkan pasangan Marta Kostyuk/Marcelo Arevalo di All England Lawn Tennis &amp; Croquet Club, London, Inggris, Selasa (11/7).</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Selepas pertandingan, Aldila tak memberikan semangat kepada Middelkoop dan semua pihak yang telah mendukung perjuangan mereka.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">\"Lolos semifinal. Ayo berjuang lagi besok @mside83,\" tulis Aldila sambil membubuhkan emoji lengan berotot pertanda semangat.</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">\"Terima kasih atas semua dukungan,\" tambah Aldila.</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Aldila dan Middelkoop berhasil meraih kemenangan meyakinkan lewat permainan dua set dengan skor 7-5, 7-6 (7-5). Aldila/Middelkoop memenangi duel ketat yang berlangsung 83 menit.</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Hasil ini membuat Aldila/Middelkoop sukses menjejakkan kaki di babak semifinal.</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Pasangan Indonesia dan Belanda ini menunggu pemenang pertandingan semifinal lainnya yang mempertemukan Latisha Chan/Ivan Dodig vs Xu Yifan/Joran Vliegen.</span></p><p><img src=\"data:image/png;base64,\" data-filename=\"tenis.png\" style=\"width: 790.8px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Torehan impresif di Wimbledon 2023 membuat Aldila/Middelkoop sejauh ini menyamai prestasi di turnamen sebelumnya, French Open 2023.</span><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Sayang, langkah Aldila/Middelkoop di French Open 2023 terhenti di semifinal usai disingkirkan pasangan Miyu/Kato/Tim Putz dalam pertandingan yang berlangsung dua set dengan skor 5-7, 0-6.</span><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br></span><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br></span><br></p>', 'uploads/img/2/1689121969_ca8370531666ca939ec6.jpeg', '2023-07-12 07:32:49', '2023-07-12 07:37:23', 'active', 3, 7);
INSERT INTO `news` (`id_news`, `title`, `sub_title`, `content`, `thumb`, `created_at`, `updated_at`, `status`, `id_category`, `id`) VALUES
(8, 'Kabar Baik! Honorer Bakal Dapat Dana Pensiun', 'Jakarta, NEWSHub. - Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PANRB) Abdullah Azwar Anas mengungkapkan bahwa pemerintah tengah membahas rencana pemberian pensiun bagi pegawai honorer atau Pegawai Pemerintah dengan Perjanjian Kerja (PPPK).', '<p style=\"margin-top: 16px; margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Rencana ini dikabarkan akan dimuat dalam draf RUU ASN yang tengah dibahas. Anas mengungkapkan bahwa pemerintah tengah fokus pada skema pensiun honorer.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Di sini kita bahas bagaimana teman-teman honorer non-ASN ke depan juga bisa dapat pensiun,\" ujarnya saat ditemui di DPR RI, dikutip Selasa (12/7/2023).</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Ini paling penting sehingga dengan begitu mereka misalnya yang sudah bekerja dia akan mendapatkan pensiun. itu salah satu poin yang juga dibahas dalam undang-undang (ASN) ini,\" paparnya.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Dalam kesempatan ini, dia menegaskan bahwa RUU ASN ini akan menjamin kepastian teman-teman honorer untuk tetap bekerja. Hal ini sesuai dengan arahan Presiden Joko Widodo bahwa penghapusan tenaga honorer kelak tidak akan berbuntut pada PHK massal dan pembengkakan anggaran.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Tidak ada pemberhentian massal, tapi juga tidak ada pembengkakan anggaran,\" kata Anas.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Oleh karena itu, dia mengatakan pemerintah telah menyiapkan jabatan baru yakni PPPK part time atau paruh waktu. Dengan kepastian ini, maka diharapkan ketakutan akan PHK massal dapat diredam. Dia memastikan DPR dan pemerintah telah menyepakati pengamanan bagi 2,4 juta pegawai honorer ini. Kendati demikian, Anas mengaku bahwa pembahasan mengenai gaji dan skema peralihan status belum dibahas lebih lanjut.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\"></p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">Sambil menunggu RUU ASN disahkan, pemerintah akan menyurati kepala daerah untuk mulai menganggarkan pensiunan dan gaji PPPK paruh waktu ini karena pembahasannya akan dimulai tahun 2024.</p><p style=\"margin-bottom: 20px; font-family: Arial, Helvetica, Tahoma; font-size: 17px;\">\"Kalau nanti gak ada anggarannya kan gak bisa digaji nanti jadi masalah,\" ungkapnya.</p>', 'uploads/img/5/1689122204_c14f82d6b4942fd51c5a.jpeg', '2023-07-12 07:36:44', '2023-07-12 07:37:33', 'active', 1, 5);

